const e=JSON.parse('{"key":"v-27d23716","path":"/quality/design-mode/design-facade.html","title":"外观模式","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"一、概述","slug":"一、概述","link":"#一、概述","children":[]},{"level":2,"title":"二、结构","slug":"二、结构","link":"#二、结构","children":[]},{"level":2,"title":"三、案例","slug":"三、案例","link":"#三、案例","children":[]},{"level":2,"title":"四、使用场景","slug":"四、使用场景","link":"#四、使用场景","children":[]},{"level":2,"title":"五、源码解析","slug":"五、源码解析","link":"#五、源码解析","children":[]}],"git":{"createdTime":1673767263000,"updatedTime":1673767263000,"contributors":[{"name":"xuliang","email":"895252461@qq.com","commits":1}]},"readingTime":{"minutes":4.11,"words":1234},"filePathRelative":"quality/design-mode/design-facade.md","localizedDate":"2023年1月15日","excerpt":"<h1> 外观模式</h1>\\n<h2> 一、概述</h2>\\n<p>有些人可能炒过股票，但其实大部分人都不太懂，这种没有足够了解证券知识的情况下做股票是很容易亏钱的，刚开始炒股肯定都会想，如果有个懂行的帮帮手就好，其实基金就是个好帮手，支付宝里就有许多的基金，它将投资者分散的资金集中起来，交由专业的经理人进行管理，投资于股票、债券、外汇等领域，而基金投资的收益归持有者所有，管理机构收取一定比例的托管管理费用。</p>\\n<p><strong>定义：</strong></p>\\n<p>​\\t又名门面模式，是一种通过为多个复杂的子系统提供一个一致的接口，而使这些子系统更加容易被访问的模式。该模式对外有一个统一接口，外部应用程序不用关心内部子系统的具体的细节，这样会大大降低应用程序的复杂度，提高了程序的可维护性。</p>"}');export{e as data};
